import React from 'react';

const Page = () => {
    return (
        <form>
            <label>
                Nome do campeonato:
                <input type="Text" name="nomeCampeonato" />
            </label>
            <label>
                Data:
                <input type="Text" name="nomeCampeonato" />
            </label>
            <input type="submit" value="Cadastrar" />
        </form>
    );
}

export default Page;
